INSERT INTO `event` VALUES (801,'The Trip To Italy','Two men, six meals in six different places on a road trip around Italy. Liguria, Tuscany, Rome, Amalfi and ending in Capri.',2,'M',10,50,0,100),(802,'The Two Faces Of January','A thriller centered on a con artist, his wife, and a stranger who flee Athens after one of them is caught up in the death of a private detective.',2,'M',10,150,0,100),(803,'The Rocky Horror Picture Show','A newly engaged couple have a breakdown in an isolated area and must pay a call to the bizarre residence of Dr. Frank-N-Furter.',2,'M',10,50,0,150),(804,'The Disappearance Of Eleanor Rigby: Them','One couple\'s story as they try to reclaim the life and love they once knew and pick up the pieces of a past that may be too far gone.',2,'M',10,50,0,150),(805,'God Help The Girl','As Eve begins writing songs as a way to sort through some emotional problems, she meets James and Cassie, two musicians each at crossroads of their own.',2,'M',10,150,0,200),(806,'Listen Up Philip','Anger rages in Philip as he awaits the publication of his second novel. He feels pushed out of his adopted home city by the constant crowds and noise, a deteriorating relationship with his photographer girlfriend Ashley, and his own indifference to promoting the novel. When Philip\'s idol Ike Zimmerman offers his isolated summer home as a refuge, he finally gets the peace and quiet to focus on his favorite subject: himself.',2,'M',10,50,0,175),(807,'The Babadook','A single mother, plagued by the violent death of her husband, battles with her son`s fear of a monster lurking in the house, but soon discovers a sinister presence all around her.',2,'M',10,50,0,125),(808,'Song Of The Sea','Saoirse, a little girl who can turn into a seal, goes on an adventure with her brother to save the spirit world and other magical beings like her.',2,'M',10,100,0,150),(809,'Match','As a Juilliard professor is interviewed by a woman and her husband for her dissertation on the history of dance in 1960\'s New York, it becomes increasingly clear that there are ulterior motives to the couple\'s visit.',2,'M',10,150,0,100),(810,'The Wrecking Crew','What the Funk Brothers did for Motown…The Wrecking Crew did, only bigger, for the West Coast Sound. Six years in a row in the 1960’s and early 1970’s, the Grammy for “Record of the Year” went to Wrecking Crew recordings. And now,The Wrecking Crew tells the story in pictures and that oh, so glorious sound. The favorite songs of a generation are all here, presented by the people who made them for you. The Wrecking Crew is a documentary film produced and directed by Denny Tedesco, son of legendary late Wrecking Crew guitarist Tommy Tedesco. The film tells the story of the unsung musicians that provided the backbeat, the bottom and the swinging melody that drove many of the number one hits of the 1960’s. It didn’t matter if it was Nat “King” Cole, Frank Sinatra, Nancy Sinatra, The Monkees, The Byrds or The Beach Boys, these dedicated musicians brought the flair and musicianship that made the American “west coast sound” a dominant cultural force around the world. The film is a fun and moving tribute from Denny to his father and to the music, the times and to the secret star-making machine known only as “The Wrecking Crew”. (C) Magnolia',2,'M',10,150,0,150),(811,'Meru','In the high-stakes pursuit of big-wall climbing, the Shark’s Fin on Mount Meru may be the ultimate prize. Sitting 21,000 feet above the sacred Ganges River in Northern India, the mountain’s perversely stacked obstacles make it both a nightmare and an irresistible calling for some of the world’s toughest climbers. In October 2008, renowned alpinists Conrad Anker, Jimmy Chin and Renan Ozturk arrived in India to tackle Meru. Their planned seven-day trip quickly declined into a 20-day odyssey in sub-zero temperatures with depleting food rations. Despite making it to within 100 meters of the elusive summit, their journey, like everyone before them, was not a successful one. Heartbroken and defeated, the trio returned to their everyday lives, where the siren song of Meru continued to beckon. By September 2011, Anker had convinced his two lifelong friends to undertake the Shark’s Fin once more, under even more extraordinary circumstances than their first attempt. Meru is the story of that journey, an expedition through nature’s harshest elements and one’s complicated inner demons, and ultimately on to impossible new heights.',2,'M',10,100,0,150),(812,'Queen of Earth','Catherine has entered a particularly dark period in her life: her father, a famous artist whose affairs she managed, has recently died, and on the heels of his death she’s dumped by her boyfriend James. Looking to recuperate, Catherine heads out to her best friend Virginia’s lake house for some much needed relaxation. However, once Catherine arrives relaxation proves impossible to find, as she is overcome with memories of time spent at the same house with James the year before. As Catherine reaches out to Virginia with attempts at connection, Virginia begins spending increasing amounts of time with a local love interest, Rich, and fissures in the relationship between the two women begin to appear, sending Catherine into a downward spiral of delusion and madness.',2,'M',10,50,0,100),(813,'The American Nurse','The American Nurse Project aims to elevate the voice of nurses in this country by capturing their personal stories through photography and film. In early 2012, photographer Carolyn Jones and her team began a journey across the United States, recording the unique experiences of nurses at work. The photographs and narratives aim to inspire audiences to think about nurses in a way that they may never have before, with a newfound appreciation for this indispensable figure on the front lines of health and healthcare today: the American nurse.',2,'M',10,150,0,175),(814,'Jimmy\'s Hall','During the Depression, Jimmy Gralton returns home to Ireland after ten years of exile in America. Seeing the levels of poverty and oppression, the activist in him reawakens and he looks to re-open the dance hall that led to his deportation.',2,'M',10,150,0,125),(815,'Goodnight Mommy','In the heat of the summer. A lonesome house in the countryside between woods and corn fields. Nine-year-old twin brothers are waiting for their mother. When she comes home, bandaged after cosmetic surgery, nothing is like before. The children start to doubt that this woman is actually their mother. It emerges an existential struggle for identity and fundamental trust. ',2,'M',10,150,0,175),(816,'Steve Jobs: The Man in the Machine','Oscar-winning director Alex Gibney (Going Clear: Scientology and the Prison of Belief) pulls no punches in his portrait of Apple founder Steve Jobs and his legacy. This probing and unflinching look at the life and aftermath of the bold, brilliant and at times ruthless iconoclast explores what accounted for the grief of so many when he died.',2,'M',10,50,0,125),(817,'The Final Girls','A young woman grieving the loss of her mother, a famous scream queen from the 1980s, finds herself pulled into the world of her mom’s most famous movie. Reunited, the women must fight off the film’s maniacal killer. ',2,'M',10,150,0,175),(818,'Best of Enemies','In the summer of 1968 television news changed forever. Dead last in the ratings, ABC hired two towering public intellectuals to debate each other during the Democratic and Republican national conventions. William F. Buckley Jr. was a leading light of the new conservative movement. A Democrat and cousin to Jackie Onassis, Gore Vidal was a leftist novelist and polemicist. Armed with deep-seated distrust and enmity, Vidal and Buckley believed each other’s political ideologies were dangerous for America. Like rounds in a heavyweight battle, they pummeled out policy and personal insult—their explosive exchanges devolving into vitriolic name-calling. Live and unscripted, they kept viewers riveted. Ratings for ABC News skyrocketed. And a new era in public discourse was born.',2,'M',10,50,0,200),(819,'Amy','Amy tells the story of six-time Grammy-winner Amy Winehouse – in her own words. A once-in-a-generation talent, Amy Winehouse was a musician that captured the world’s attention. A pure jazz artist in the most authentic sense – she wrote and sung from the heart using her musical gifts to analyze her own problems. The combination of her raw honesty and supreme talent resulted in some of the most unique and adored songs of the modern era. Her huge success, however, resulted in relentless and invasive media attention which coupled with Amy’s troubled relationships and precarious lifestyle saw her life tragically begin to unravel. Amy Winehouse died from alcohol poisoning in July 2011 at the age of 27.',2,'M',10,50,0,125),(820,'Of Men and War','The warriors in Of Men and War have come home to the United States, but their minds remain on the battlefield. Anger consumes them long after their return from the front. Like figures from a Greek tragedy, all have traumatic memories that haunt them to this day. At The Pathway Home, a first-of-its-kind PTSD therapy center, the film\'s subjects resolve to end the ongoing destruction of their wellbeing. Their therapist, who is also a Vietnam Vet, helps the young men forge meaning from their trauma. Over years of therapy, the film explores their grueling paths to recovery, as they attempt to make peace with their past, their families and themselves.',2,'M',10,50,0,50),(821,'Breathe','Charlie is an average French suburban teenager, but when she becomes fast friends with Sarah, the rebellious new girl at school.',2,'M',10,50,0,50),(822,'The Second Mother','When the estranged daughter of a hard-working live-in housekeeper suddenly appears, the unspoken class barriers that exist within the home are thrown into disarray.',2,'M',10,50,0,50),(823,'Finders Keepers','Shannon Whisnant purchased a grill at an auction. Inside the grill was an amputated leg. What follows is a story centered on the enterprising Whisnant and John Wood, the man whose leg wound up in the grill due to an odd chain of events',2,'M',10,50,0,50),(824,'White Christmas','A successful song-and-dance team become romantically involved with a sister act and team up to save the failing Vermont inn of their former commanding general.',2,'M',10,50,0,50),(825,'Orion: The Man Who Would Be King','There are many that believe that Elvis is still alive - if he is alive he wears a mask and goes by the name Orion Nashville News 1979 ORION tells the story of Jimmy Ellis - an unknown singer plucked from obscurity, and thrust into the spotlight as part of a crazy scheme that had him masquerade as Elvis back from the grave. With an outlandish fictional identity torn from the pages of the best selling novel Orion by Gail Brewer Giorgio, the backing of the legendary birthplace of rock \'n roll; Sun Records and a voice that seemed to be the very twin of Presley\'s himself, the scheme - concocted in the months after Presley\'s death exploded into a cult success - and the \'Elvis is alive\' myth was begun.',2,'M',10,50,0,50),(826,'Boy & the World','A little boy goes on an adventurous quest in search of his father.',2,'M',10,50,0,50),(827,'Grandma','A teenager facing an unplanned pregnancy seeks help from her acerbic grandmother, a woman who is long estranged from her daughter.',2,'M',10,50,0,50),(828,'Oscar Nominated Short Films','',2,'M',10,50,0,50),(829,'Macbeth','Macbeth, the Thane of Glamis, receives a prophecy from a trio of witches that one day he will become King of Scotland. Consumed by ambition and spurred to action by his wife, Macbeth murders his king and takes the throne for himself.',2,'M',10,50,0,50),(830,'Tumbledown','A young woman struggles to move on with her life after the death of her husband, an acclaimed folk singer, when a brash New York writer forces her to confront her loss and the ambiguous circumstances of his death.',2,'M',10,50,0,50),(831,'Love & Mercy','In the 1960s, Beach Boys leader Brian Wilson struggles with emerging psychosis as he attempts to craft his avant-garde pop masterpiece. In the 1980s, he is a broken, confused man under the 24-hour watch of shady therapist Dr. Eugene Landy.',2,'M',10,50,0,50),(832,'Mustang','When five orphan girls are seen innocently playing with boys on a beach, their scandalized conservative guardians confine them while forced marriages are arranged.',2,'M',10,50,0,50),(833,'Cartel Land','A physician in Michoacán, Mexico leads a citizen uprising against the drug cartel that has wreaked havoc on the region for years. Across the U.S. border, a veteran heads a paramilitary group working to prevent Mexico\'s drug wars from entering U.S. territory.',2,'M',10,50,0,50),(834,'Labyrinth of Lies','A story that exposes the conspiracy of prominent German institutions and government branches to cover up the crimes of Nazis during World War II.',2,'M',10,50,0,50),(835,'Manpower','Immigration police officer Meir, returns from a tour to Buchenwald concentration camp,a prize for decorated policemen, to a brutal deportation of African labor immigrants. A story of manhood in crisis, Manpower is an ironic yet compassionate film about belonging and upheaval, exile and immigration, home and family.',2,'M',10,50,0,50),(836,'Embrace of the Serpent','The story of the relationship between Karamakate, an Amazonian shaman and last survivor of his people, and two scientists who work together over the course of 40 years to search the Amazon for a sacred healing plant.',2,'M',10,50,0,50),(837,'Son of Saul ','In the horror of 1944 Auschwitz, a prisoner forced to burn the corpses of his own people finds moral survival upon trying to salvage from the flames the body of a boy he takes for his son.',2,'M',10,50,0,50),(838,'Only Yesterday','A 27-year-old office worker travels to the countryside while reminiscing about her childhood in Tôkyô.',2,'M',10,50,0,50),(839,'Marguerite','Paris, 1920s. Marguerite Dumont is a wealthy woman, lover of the music and the opera. She loves to sing for her friends, although she\'s not a good singer. Both her friends and her husband have kept her fantasy. The problem begins when she decides to perform in front of a real audience.',2,'M',10,50,0,50),(840,'Anomalisa','A man crippled by the mundanity of his life experiences something out of the ordinary.',2,'M',10,50,0,50),(1111,'Don’T Dress For Dinner','A major hit on Broadway and in London, this wildly funny sequel to Boeing-Boeing is an affair-or three!-to remember. Bernard’s plans for a romantic rendezvous with his mistress are complete with a gourmet caterer and an alibi courtesy of his friend, Robert. But when Bernard’s wife learns that Robert will be visiting for the weekend, she decides to stay in town, setting the stage for a collision course of assumed identities and outrageous infidelities. Everyone is guaranteed a good time at this hilarious romp through the French countryside.',1,'T',30,900,2500,20),(1112,'Good People','This recent Broadway hit is dramatically funny and surprisingly touching. Welcome to Southie, a Boston neighborhood where a night on the town means a few rounds of bingo, where this month’s paycheck covers last month’s bills, and where Margie Walsh has just been let go from yet another job. Facing eviction, Margie thinks an old fling who’s made it out might be her ticket to a fresh new start. But is this self-made man - now a successful doctor - secure enough to face his humble beginnings? As Margie risks all for a new start, will her luck finally change for the better?',1,'T',30,900,2500,20),(1113,'Avenue Q','The crown on the Hippodrome’s 40th Anniversary season is the internationally beloved Broadway sensation AVENUE Q. Winner of the Tony Award’s “Triple Crown” for Best Musical, Best Score and Best Book, AVENUE Q is a coming-of-age musical where characters lament that as children, they were assured by their parents, and by certain fuzzy puppets on public television, that they were “special” and “could do anything”; but as adults, they have discovered to their surprise and dismay that in the real world their options are limited, and they are no more “special” than anyone else.',1,'T',30,1000,1500,30),(1114,'Carrie','A southeastern premiere! This Halloween season, the Hippodrome takes on a campy twist with the comedic stage version of Carrie that will have you screaming with laughter! Based on Stephen King’s first published, and best-selling novel, it’s the story of a girl who is bullied at school, isolated at home by her fundamentalist mother, and endures the worst prom ever! Carrie White eventually exacts revenge using her telekinetic powers - resulting in an unforgettably spooky and uproarious night at the theatre!',1,'T',30,700,2000,30),(1115,'King O\' The Moon','Last year, Gainesville fell in love with the Pazinski family. They’re back! “with bigger problems and bigger laughs than before.',1,'T',30,800,3500,50),(1116,'Zombie Town: A Documentary Play','Hungry for braaaaaains? Join the walking dead of Harwood, Texas as a theatre troupe attempts to interview the survivors of its zombie apocalypse.',1,'T',30,900,2000,30),(1117,'Robin Hood','Robin Hood bursts from the stage with fast action and comedic hijinks as the Prince of Thieves and his Merry Men do all the wrong things for all the right reasons. With narrow escapes, hilarious surprises, and even romance, this legendary tale of good versus evil is an unforgettable, fun-filled adventure for the entire family.',1,'T',30,700,1500,50),(1118,'A Christmas Carol','The entire family will enjoy the dazzling special effects and timeless message of redemption in this heartwarming tale now in its 37th consecutive year at the Hippodrome.',1,'T',30,900,1500,40),(1119,'Other Desert Cities','Meet the Wyeths. A family that appears to have it all - wealth, political influence, and A-list connections. They are “living the dream” in Palm Springs, California. But their carefully crafted facade is on the verge of shattering when daughter Brooke reveals the impending publication of her “tell-all” memoir. Other Desert Cities is a richly satisfying exploration of the faultlines that exist between privacy, artistic expression, explosive family secrets, and the truth. With crackling wit, razor-sharp one-liners, a fierce cast of characters, and a storyline that grabs you and won’t let go - Other Desert Cities is a “must-see” way to kick off the Hipp’s 40th Anniversary Season.',1,'T',30,800,3000,20),(1120,'The Tempest','Sail away with us on a fantastical adventure of revenge and redemption featuring a raging storm, shipwrecked royalty, a banished magician, and an island full of unique and mischievous spirits. After many years of being banished on a wild and mysterious island, Prospera desires revenge on the sister who betrayed her, and the restoration of her daughter Miranda’s royal birthright.  Wielding powerful magic, Prospera conjures a great tempest to wash ashore some unsuspecting royals and finds herself in the center of an incredible odyssey of family, love, and mercy.  Shakespeare’s classic fantasy tale is an adventure for all ages!',1,'T',30,700,1500,50),(1121,'Leveling Up','The Hipp received an NEA grant to produce this new work by award-winning playwright Deborah Zoe Laufer (author of Sirens and End Days) in partnership with UF’s Digital Worlds Institute. Four friends confront the moral ambiguities raised by the blurred line between reality and fantasy in this thought-provoking, humorous, and entertaining look at how we navigate our lives in an unexplored digital age.',1,'T',30,900,2000,20),(1122,'Clybourne Park','The Hippodrome partners with the University of Florida School of Theatre and Dance on this landmark co-production. Clybourne Park is a wickedly funny, entertainingly provocative, and fiercely intelligent play about race, real estate, and the volatile values of each, and won nearly every honor the theatre has to offer, including the Olivier Award, the Evening Standard Award, and the Pulitzer Prize. Broadway’s hottest ticket will have all of Gainesville talking!',1,'T',30,800,1500,40),(1123,'Slasher','A Florida Premiere! This uproarious comedy will have you screaming with laughter and surprise! Alfred Hitchcock started the slasher genre with the classic film Psycho in 1960, and since then hundreds of horror films have sent thrills down our spines each Halloween, including Friday the 13th, A Nightmare of Elm Street, and Scream. The Hipp is well known for staging the area’s best Halloween-themed productions, and this Halloween comedy takes you behind-the-scenes of a Hollywood slasher movie.',1,'T',30,700,1500,30),(1124,'Vanya And Sonia And Masha And Spike','Regret and sibling rivalry fan the flames of laughter in this wickedly wonderful Chekhovian mash-up from Tony and Obie Award winning playwright Christopher Durang. Melancholy turns into mayhem when Vanya and his sister Sonia—along with their clairvoyant housekeeper Cassandra—are paid a surprise visit by their Hollywood star sibling Masha and her twenty something boy toy Spike. Will Vanya and Sonia ever find happiness? Will Masha sell the Bucks County farmhouse out from under them? And will Spike ever put his pants on?',1,'T',30,800,3000,50),(1125,'Mr. Burns, A Post-Electric Play','The theatrical event of the season! In this dark comedy set 100 years in the future, a new civilization uses current pop culture references including TVs longest-running hit show THE SIMPSONS, to frame its present. Mr. Burns, A Post-Electric Play explores what will endure when the apocalypse arrives—when the grid fails, society crumbles, and we’re faced with the task of rebuilding.',1,'T',30,900,3000,40),(1126,'The Two Musketeers','A World Premiere! When a small acting company eliminates one Musketeer from their production of The Three Musketeers due to budget constraints, the rest of the cast must sally forth bravely with only two. The classic tale of d’Artagnan and his sword-fighting friends is presented with hilarity, romance, wit, and derring-do to spare. This high-comedy adaptation is a witty send-up of Alexandre Dumas’ beloved adventure.',1,'T',30,900,3500,30),(1127,'Peter and the Starcatcher','Pirates, shipwrecks, mermaids and magic abound as the Neverland sets sail across stormy seas. A hilariously fast-paced adventure explodes across the stage as an unnamed orphan transforms into the legendary Peter Pan. This critically acclaimed Broadway hit will have you hooked from the first swashbuckling moment. All it takes is a sprinkling of stardust for your imagination to take flight on an unforgettable journey!',1,'T',30,800,2500,40),(1128,'All Girl Frankenstein ','This Halloween season, you will be haunted by a smoldering re-telling of Frankenstein in a dark and seductive adaptation of Mary Shelley’s forbidding tale.',1,'T',30,1000,3500,30),(1129,'The Snow Queen ','A classic tale of friendship, love, and bravery, “The Snow Queen” is now beautifully retold in a new theatrical adaptation commissioned by the Hippodrome. Kai and Gerda are childhood best friends, but when Kai falls under the spell of the wicked Snow Queen, Gerda sets out on magical adventure to rescue him from her evil enchantment. Full of mystery and fantasy, this delightful new production is a holiday must-see for the entire family.',1,'T',30,900,1500,50),(1130,'A Christmas Carol','The entire family will enjoy the dazzling special effects and timeless message of redemption in this heartwarming tale now in its 37th consecutive year at the Hippodrome.',1,'T',30,700,1500,30),(1131,'Collected Stories','A riveting and emotionally charged exploration of the intersection of friendship and creative freedom, this comedic drama was originally produced on Broadway and London’s West End. In a walk-up apartment in Greenwich Village, a distinguished professor of creative writing reluctantly agrees to mentor an ambitious student, and over the course of six years, the two women are lead to question, “Who owns the story of your life?”',1,'T',30,800,2000,40),(1132,'Women in Jeopardy','In this laugh-out-loud flirtatious new comedy, imaginations run wild when a group of friends trade their wine glasses for spy glasses to solve a hilariously mad-cap mystery.',1,'T',30,900,2500,30),(1133,'The Elephant Man','Winner of the Tony Award for Best Play, this compelling story recently enjoyed a sold-out Broadway revival. The Elephant Man is based on the real life of Joseph Merrick, a 19th century British man on the traveling freak show circus, who was later rescued by a caring doctor and went on to become the darling of Victorian high-society. This production celebrates the 35th anniversary of the Hippodrome’s first production on our current mainstage.',1,'T',30,800,3000,20);
