INSERT INTO `playquote` VALUES (1,1111,'\"Hipp guest director Jim Wren has assembled a stellar cast to deliver a tale well paced and acted.\"—Ron Cunningham, Gainesville Sun'),(2,1111,'\"A home run of a fun night at the theater\" —Mike Sanford, The Daily Glob'),(3,1116,'A thoroughly amusing evening of gore-lite fare \" —Ron Cunningham, Gainesville Sun'),(4,1116,'\"Spectacle, music, hyperbolic staging, and a pack of zombies so fierce and freaky, they make the zombies of Thriller look like they belong in Mr. Rogers neighborhood. \" —Tom Miller\'s Secret Site'),(5,1112,'Really, really funny. Painfully funny and gut-wrenchingly real.” — Washingtonian'),(6,1112,'\"A spectacular performance in a unique stage setting. This is a \'Must See\' production.\" —Don Simson, Jack\'s Theatre Blog'),(7,1112,'\"In those odd moments when the laughter does abate, you can practically hear a pin drop.\" —Ron Cunningham, Gainesville Sun'),(8,1112,'\"Going to the Hipp is like taking a trip to New York. The quality of their productions is the reason they have been so successful for over forty years.\"—Dick Kerekes & Leisla Sansom, EUJacksonville.com'),(9,1112,'\"The Hippodrome Scores a Full-Card Bingo with Good People!\" —Tom Miller\'s Secret Site'),(10,1113,'\"Wildly entertaining musical comedy\" —Ron Cunningham, Gainesville Sun'),(11,1113,'\"All were outstanding and superb with great voices and comic timing and all had the talent and skill to bring their characters to life.\" —Dick Kerekes & Leisla Sansom, EntertainingU.com'),(12,1117,'\"This is a fast-paced laugh fest interrupted only by occasional lapses into Looney Tunes-like action sequences and flickering surrealism.\" —Ron Cunningham, Gainesville Sun'),(13,1115,'\"This fast-paced tale, which is well told and well acted, will make you laugh.\" —Ron Cunningham, Gainesville Sun'),(14,1115,'\"A Must-See for outstanding ensemble theatre\" —Jack Petro, Jack\'s Theatre'),(15,1114,'\"Playwright Erik Jackson and director Lauren Caldwell have turned Stephen King’s horror classic into a campy comedy full of black humor and fun.\" —Diana Tonnessen, Gainesville Sun'),(16,1114,'\"A crazy, campy play that is a treat – not a trick ... a Halloween treat you do not want to miss.\" —Jack Petro, Jack\'s Theatre '),(17,1119,'\"Other Desert Cities unleashes a torrent of acting intensity that builds to a crescendo.\" —Bill Dean, Gainesville Sun'),(18,1119,'\"An evening at the Hippodrome draws a favorable comparison to anything you would see on Broadway. I cannot say enough good things about the actors, director, or scenic designer.\" —Don Simson, Jack\'s Theatre Blog'),(19,1120,'\"SEE THIS PLAY! See it with someone you can talk with about it.\" —Tom Miller\'s Secret Site'),(20,1120,'\"Really, this \'Tempest\' is worth weathering. The cast is lively. The plot engaging. And if the Bard’s tale is indeed woven whole cloth from the “stuff of dreams,” then the Hipp’s backstage crew deserves much credit for creating an appropriately dreamy environment.\" —Ron Cunningham, '),(21,1121,'“Couldn’t be more topical ... Laufer knows how to energize a script and bring the funny.\" —Cincinatti.com'),(22,1121,'\"Leveling Up a guilty pleasure that will put you in stitches\" —Ron Cunningham, Gainesville Sun'),(23,1122,'\"Hilariously funny! A master class in comic writing and playing.\" —New Yorker'),(24,1122,'“Clybourne Parkis a great piece of writing brought vividly to life by a skilled and committed group of performers.\" —Bryan Faux, Alligator'),(25,1122,'\"What makes Clybourne Park such a pleasure to watch is the easy ability of this capable cast to reverse roles \" —Ron Cunningham, Gainesville Sun'),(26,1123,'\"An offbeat comedy laugh fest of clever puns and pokes and winks at a genre of films we love to hate.\" —Mike Sanford, Art & About'),(27,1123,'\"An insider’s view of the horror-movie genre...It’s a job well done!\" —San Francisco Examiner'),(28,1124,'\"Broad comic acting is raised to the level of high art…deliriously funny.\" —NY Times'),(29,1124,'\"Fantastic ...filled to burst with off-kilter humor, boisterous acting, and a sweet modern message.\" — Letitia Carelock, Showbiz NoFlo'),(30,1124,'\"Vanya and Sonia and Masha and Spike is entertaining stuff indeed.\" —Ron Cunningham, Gainesville Sun'),(31,1125,'\"The writing, the singing, the word-play, the dialogue, the puzzle of cultural identity, the intelligence--this play is a stunner!\" —Tom Miller\'s Secret Site'),(32,1125,'\"Visually stunning, emotionally absorbing, bitingly funny, oddly lyrical, and — yes — even electrifying.\" —Ron Cunningham, Gainesville Sun'),(33,1127,'\"A witty, clever script and a fantastical adventure story meet in a hilarious middle in the Hippodrome Theatre’s new production of “Peter and the Starcatcher.\"'),(34,1127,'\"What sets this show apart from others is the magic of imagination. The actors are engaging, as they tell their story using interesting props, like a stuffed gray cat and a large crocodile, exaggerated gestures, witty retorts, and athletic maneuvers. As audience members, we were at first confused by the style, but quickly caught on and immersed ourselves in the unfolding action.\"'),(35,1131,'“This is probably Margulies’ best play to date…” —NY Post'),(36,1131,'“Fluid and lively, the play is thick with ideas, like a stockpot of good stew.” —Village Voice'),(37,1132,'“’Women in Jeopardy!’ could be titled ‘Audience in Stitches’. It’s one of the funniest nights of theatre I can recall.” —Rochester Democrat and Chronicle');
